args.query:
SELECT ?voltageLevel ?name WHERE {
  <urn:uuid:f17695e5-9aeb-11e5-91da-b8763fd99c5f> cim:Substation.VoltageLevels ?voltageLevel .
  ?voltageLevel cim:IdentifiedObject.name ?name .
} ORDER BY ?name

SELECT ?contingency ?contingencyName WHERE {
  ?ce cim:IdentifiedObject.name "CE 300KRISTIAN-ARENDAL" .
  ?ce a cim:ContingencyElement .
  ?ce cim:ContingencyElement.Contingency ?contingency .
  ?contingency cim:IdentifiedObject.name ?contingencyName .
}

SELECT DISTINCT ?toponode ?toponame WHERE {
  # Find terminals of the equipment
  ?terminal cim:Terminal.ConductingEquipment <urn:uuid:f17697fa-9aeb-11e5-91da-b8763fd99c5f> .
  # Get the topological node connected to each terminal
  ?terminal cim:Terminal.TopologicalNode ?toponode .
  OPTIONAL { ?toponode cim:IdentifiedObject.name ?toponame }
}

SELECT DISTINCT ?topologicalNode WHERE {
  # Find terminals of the equipment
  ?terminal cim:Terminal.ConductingEquipment <urn:uuid:f176975e-9aeb-11e5-91da-b8763fd99c5f> .
  # Find topological nodes connected to those terminals
  ?terminal cim:Terminal.TopologicalNode ?topologicalNode .
}

SELECT DISTINCT ?topoNode WHERE {
  # Get the terminals of the NonConformLoad
  <urn:uuid:f176972e-9aeb-11e5-91da-b8763fd99c5f> <https://cim.ucaiug.io/ns#Equipment.Terminals> ?terminal .
  # Get the TopologicalNode associated with each terminal
  ?terminal <https://cim.ucaiug.io/ns#Terminal.TopologicalNode> ?topoNode .
}

SELECT DISTINCT ?topoNode WHERE {
  # Get the terminals of the NonConformLoad
  ?terminal <https://cim.ucaiug.io/ns#Terminal.ConductingEquipment> <urn:uuid:f176972e-9aeb-11e5-91da-b8763fd99c5f> .
  # Get the TopologicalNode associated with each terminal
  ?terminal <https://cim.ucaiug.io/ns#Terminal.TopologicalNode> ?topoNode .
}

SELECT ?connectedBusbarSection WHERE {
  ?equipment cimr:mridSignificantPart "2dd90199" .
  ?equipment a cim:ConductingEquipment .
  ?equipment cimr:connectedTo ?connectedBusbarSection .
  ?connectedBusbarSection a cim:BusbarSection .
}

SELECT DISTINCT ?connectedBusbar ?connectedBusbarName WHERE {
  VALUES ?busbar { <urn:uuid:2dd901a3-bdfb-11e5-94fa-c8f73332c8f4> }
  ?busbar a cim:BusbarSection .
  ?busbar cim:Terminal.ConductingEquipment ?busbar .
  ?busbar cim:Terminal.ConnectivityNode ?cnode .
  ?otherTerminal cim:Terminal.ConnectivityNode ?cnode .
  ?otherTerminal cim:Terminal.ConductingEquipment ?connectedBusbar .
  ?connectedBusbar a cim:BusbarSection .
  FILTER(?connectedBusbar != ?busbar)
  OPTIONAL { ?connectedBusbar cim:IdentifiedObject.name ?connectedBusbarName }
}

SELECT DISTINCT ?line WHERE {
  <urn:uuid:f176967c-9aeb-11e5-91da-b8763fd99c5f> cimr:hasPartTransitive ?line .
  ?line a cim:Line .
}

SELECT DISTINCT ?line WHERE {
  ?line a cim:Line .
  ?line cimr:isPartTransitive ?substation .
  ?substation cim:IdentifiedObject.mRID "f17696c4-9aeb-11e5-91da-b8763fd99c5f" .
}

SELECT ?bay ?voltageLevel WHERE {
  ?bay cimr:mridSignificantPart "bc25cadf" .
  ?bay a cim:Bay .
  ?bay cim:Bay.VoltageLevel ?voltageLevel .
}

SELECT ?vl WHERE {
  ?bay cim:IdentifiedObject.mRID "e5943b0f-8c95-ef4c-a6f6-16b9ace48341" .
  ?bay a cim:Bay .
  ?bay cim:Bay.VoltageLevel ?vl .
}

