args.query:
SELECT ?line ?lineName WHERE {
  ?line a cim:Line .
  ?line cim:Line.Region <urn:uuid:f1769619-9aeb-11e5-91da-b8763fd99c5f> .
  OPTIONAL { ?line cim:IdentifiedObject.name ?lineName }
}

SELECT ?region WHERE {
  ?line cim:IdentifiedObject.mRID "fd79db98-7494-8348-8442-0400e115ef44" .
  ?line a cim:Line .
  ?line cim:Line.Region ?region .
}

SELECT ?line ?name ?mrid WHERE {
  ?line a cim:Line .
  ?line cim:Line.Region <urn:uuid:f17695af-9aeb-11e5-91da-b8763fd99c5f> .
  OPTIONAL { ?line cim:IdentifiedObject.name ?name }
  OPTIONAL { ?line cim:IdentifiedObject.mRID ?mrid }
}

SELECT ?role ?roleName WHERE {
  ?org cim:IdentifiedObject.mRID "27613d44-28e2-4aeb-a96b-f4a49591d629"^^xsd:string .
  ?org cim:Organisation.Roles ?role .
  OPTIONAL { ?role cim:IdentifiedObject.name ?roleName }
}

SELECT ?substation WHERE {
  ?vl cimr:mridSignificantPart "f17696aa" .
  ?vl a cim:VoltageLevel .
  ?vl cim:VoltageLevel.Substation ?substation .
}

SELECT ?substation WHERE {
  ?voltageLevel a cim:VoltageLevel ;
    cim:IdentifiedObject.mRID "f1769678-9aeb-11e5-91da-b8763fd99c5f" ;
    cim:VoltageLevel.Substation ?substation .
}

SELECT DISTINCT ?baseVoltage ?nominalVoltage
WHERE {
  ?island a cim:TopologicalIsland ;
          cim:IdentifiedObject.mRID "b04002c8-53a3-11e8-a5aa-74e5f963e191" ;
          cim:TopologicalIsland.TopologicalNodes ?node .
  ?node cim:TopologicalNode.BaseVoltage ?baseVoltage .
  ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage .
}

SELECT ?contingency WHERE {
  ?entity cimr:mridSignificantPart "8ffcf7ab" .
  ?entity a cim:ContingencyEquipment .
  ?element a cim:ContingencyElement ;
           ^cim:ContingencyElement.Contingency ?contingency .
  ?contingency nc:Contingency.normalProbability "100.0"^^xsd:float .
  ?element ^cim:ContingencyElement.Contingency ?contingency .
  FILTER(?entity = ?element)
}

SELECT ?voltageLevel ?name WHERE {
  ?voltageLevel cim:VoltageLevel.Substation ?substation .
  ?substation cim:IdentifiedObject.mRID "f176969e-9aeb-11e5-91da-b8763fd99c5f" .
  OPTIONAL { ?voltageLevel cim:IdentifiedObject.name ?name }
}

SELECT ?border ?zone WHERE {
  ?border cim:IdentifiedObject.mRID "2e7b7ea0-39a6-46ed-80a1-e887ce4c45cd" .
  ?border a nc:BiddingZoneBorder .
  {
    ?border nc:BiddingZoneBorder.BiddingZoneOne ?zone .
  } UNION {
    ?border nc:BiddingZoneBorder.BiddingZoneTwo ?zone .
  }
  ?zone a nc:BiddingZone .
  ?zone cim:IdentifiedObject.name ?zoneName .
}
ORDER BY ?zone

SELECT ?biddingZone WHERE {
  # Find the BiddingZoneBorder with the given mRID
  ?border1 cim:IdentifiedObject.mRID "a681779c-0c9a-4d1e-9b31-5e896f09b6d3" .
  ?border1 a nc:BiddingZoneBorder .

  # Find the BiddingZoneBorder with the given name (NO5 - NO2)
  BIND(<urn:uuid:8a2653a0-7f76-4f64-a346-9ae318f219dc> AS ?border2)

  # Find BiddingZones connected to both borders
  ?biddingZone a nc:BiddingZone .
  {
    { ?biddingZone nc:BiddingZone.BiddingZoneBorderOne ?border1 }
    UNION
    { ?biddingZone nc:BiddingZone.BiddingZoneBorderTwo ?border1 }
  }
  {
    { ?biddingZone nc:BiddingZone.BiddingZoneBorderOne ?border2 }
    UNION
    { ?biddingZone nc:BiddingZone.BiddingZoneBorderTwo ?border2 }
  }
}

SELECT DISTINCT ?biddingZone ?biddingZoneName WHERE {
  # First border by mRID
  ?border1 a nc:BiddingZoneBorder ;
           cim:IdentifiedObject.mRID "d2baadfc-1398-4300-bcd8-2eacd5b931aa" .
  # Second border by name
  ?border2 a nc:BiddingZoneBorder ;
           cim:IdentifiedObject.name "PL - SE4" .
  # Find BiddingZones connected to each border
  {
    ?border1 nc:BiddingZoneBorder.BiddingZoneOne|nc:BiddingZoneBorder.BiddingZoneTwo ?biddingZone .
  }
  {
    ?border2 nc:BiddingZoneBorder.BiddingZoneOne|nc:BiddingZoneBorder.BiddingZoneTwo ?biddingZone .
  }
  ?biddingZone cim:IdentifiedObject.name ?biddingZoneName .
}

SELECT ?line ?name WHERE {
  ?line a cim:Line ;
        cim:Line.Region <urn:uuid:f17696b3-9aeb-11e5-91da-b8763fd99c5f> ;
        cim:IdentifiedObject.name ?name .
} ORDER BY ?name

SELECT ?line WHERE {
  ?region cim:IdentifiedObject.mRID "f1769699-9aeb-11e5-91da-b8763fd99c5f" .
  ?region a cim:SubGeographicalRegion .
  ?region cim:SubGeographicalRegion.Lines ?line .
}

SELECT DISTINCT ?baseVoltage ?nominalVoltage WHERE {
