SELECT ?voltageLevel ?voltageLevelName WHERE {
  VALUES ?terminal { <urn:uuid:2dd90467-bdfb-11e5-94fa-c8f73332c8f4> <urn:uuid:2dd9044b-bdfb-11e5-94fa-c8f73332c8f4> <urn:uuid:2dd90459-bdfb-11e5-94fa-c8f73332c8f4> }
  ?terminal cim:ConductingEquipment ?equipment .
  ?equipment cim:Equipment.EquipmentContainer ?container .
  ?container a cim:VoltageLevel .
  OPTIONAL { ?container cim:IdentifiedObject.name ?voltageLevelName }
  BIND(?container AS ?voltageLevel)
}
LIMIT 1

SELECT ?vl WHERE { 
  <urn:uuid:0dae5d37-4d01-3645-9e94-607410c5ac34> cim:Terminal.ConductingEquipment ?eq .
  ?eq cim:Equipment.EquipmentContainer ?ec .
  ?ec a cim:VoltageLevel .
  BIND(?ec AS ?vl)
}

SELECT ?vl WHERE {
  <urn:uuid:0dae5d37-4d01-3645-9e94-607410c5ac34> cim:Terminal.ConductingEquipment ?eq .
  ?eq cimr:isPartTransitive ?ec .
  ?ec a cim:VoltageLevel .
  BIND(?ec AS ?vl)
}

SELECT ?voltageLevel WHERE {
  ?terminal cim:IdentifiedObject.mRID "e035c87e-704d-404f-8ea8-91c62e0d7d8a" .
  ?terminal cim:Terminal.ConductingEquipment ?equipment .
  ?equipment cim:Equipment.EquipmentContainer ?voltageLevel .
  ?voltageLevel a cim:VoltageLevel .
}

SELECT ?voltageLevel WHERE {
  ?terminal cim:IdentifiedObject.mRID "e035c87e-704d-404f-8ea8-91c62e0d7d8a" .
  ?terminal cim:Terminal.ConductingEquipment ?equipment .
  ?equipment cimr:isPartTransitive ?voltageLevel .
  ?voltageLevel a cim:VoltageLevel .
}

SELECT ?substation WHERE {
  ?equipment cim:IdentifiedObject.mRID "f1769834-9aeb-11e5-91da-b8763fd99c5f" .
  ?substation a cim:Substation .
  ?substation cimr:hasPartTransitive ?equipment .
}

SELECT ?substation WHERE {
  ?equipment cim:IdentifiedObject.mRID "f17698f4-9aeb-11e5-91da-b8763fd99c5f" .
  ?substation a cim:Substation .
  ?substation cimr:hasPartTransitive ?equipment .
}

SELECT DISTINCT ?substation WHERE {
  # MALMO   420 M3 is a SynchronousMachine
  VALUES ?machine { <urn:uuid:f1769a20-9aeb-11e5-91da-b8763fd99c5f> }
  # Find the equipment container (could be a VoltageLevel, Bay, or Substation) that contains the machine
  ?machine cimr:isPartTransitive ?container .
  # Find the substation that is the top-level container
  ?container (cimr:isPartTransitive)* ?substation .
  ?substation a cim:Substation .
}

SELECT DISTINCT ?busbar ?busbar_name WHERE {
  ?rc a cim:TapChangerControl ;
      cim:IdentifiedObject.name "AJAURE  T1 P C1" ;
      ^cim:RegulatingCondEq.RegulatingControl ?reg_eq .
  ?reg_eq a cim:RegulatingCondEq .
  ?reg_eq cim:RegulatingCondEq.RegulatingControl ?rc .
  ?reg_eq cim:RegulatingCondEq.Terminals ?terminal .
  ?terminal cim:Terminal.TopologicalNode ?toponode .
  ?busbar a cim:BusbarSection .
  ?busbar cim:ConductingEquipment.Terminals ?busbar_terminal .
  ?busbar_terminal cim:Terminal.TopologicalNode ?toponode .
  ?busbar cim:IdentifiedObject.name ?busbar_name .
}

SELECT DISTINCT ?busbar ?busbar_name WHERE {
  ?rc a cim:TapChangerControl ;
      cim:IdentifiedObject.name "AJAURE  T1 P C1" ;
      ^cim:RegulatingCondEq.RegulatingControl ?reg_eq .
  ?reg_eq a cim:RegulatingCondEq ;
           cim:RegulatingCondEq.RegulatingControl ?rc ;
           cim:Equipment.Terminals ?terminal .
  ?terminal cim:Terminal.TopologicalNode ?toponode .
  ?busbar a cim:BusbarSection ;
          cim:Equipment.Terminals ?busbar_terminal ;
          cim:IdentifiedObject.name ?busbar_name .
  ?busbar_terminal cim:Terminal.TopologicalNode ?toponode .
}

SELECT DISTINCT ?busbar ?busbar_name WHERE {
  ?rc a cim:TapChangerControl ;
      cim:IdentifiedObject.name "AJAURE  T1 P C1" ;
      ^cim:RegulatingCondEq.RegulatingControl ?reg_eq .
  ?reg_eq a cim:RegulatingCondEq ;
           cim:RegulatingCondEq.RegulatingControl ?rc ;
           ^cim:Terminal.ConductingEquipment ?terminal .
  ?terminal cim:Terminal.TopologicalNode ?toponode .
  ?busbar a cim:BusbarSection ;
          ^cim:Terminal.ConductingEquipment ?busbar_terminal ;
          cim:IdentifiedObject.name ?busbar_name .
  ?busbar_terminal cim:Terminal.TopologicalNode ?toponode .
}

SELECT DISTINCT ?busbarSection WHERE {
  ?entity cimr:mridSignificantPart "f1769960" .
  ?entity a cim:RegulatingControl .
  ?busbarSection cim:RegulatingCondEq.RegulatingControl ?entity .
  ?busbarSection a cim:BusbarSection .
}

SELECT ?regCtrl ?eq WHERE {
  ?regCtrl cimr:mridSignificantPart "f176987e" .
  ?eq cim:RegulatingCondEq.RegulatingControl ?regCtrl .
  ?eq a cim:BusbarSection .
}

SELECT ?node WHERE {
  ?island cimr:mridSignificantPart "b04002c8" .
  ?island a cim:TopologicalIsland .
  ?island cim:TopologicalIsland.TopologicalNodes ?node .
}

