args.query:
SELECT ?breaker ?breakerName WHERE {
  # ARENDAL 300T1 is a Bay
  BIND(<urn:uuid:07a43fc4-0dca-554d-9d57-b1b721912b5a> AS ?bay)
  ?bay ^cim:Equipment.EquipmentContainer ?breaker .
  ?breaker a cim:Breaker ;
           cim:IdentifiedObject.name ?breakerName .
}

SELECT ?breaker WHERE {
  ?bay cimr:mridSignificantPart "bc25cadf" .
  ?bay a cim:Bay .
  ?bay cim:EquipmentContainer.Equipments ?breaker .
  ?breaker a cim:Breaker .
}

SELECT ?voltageLevel WHERE {
  ?eq cimr:mridSignificantPart "2dd903bd" .
  ?eq a cim:LinearShuntCompensator .
  ?eq cim:Equipment.EquipmentContainer ?voltageLevel .
  ?voltageLevel a cim:VoltageLevel .
}

SELECT ?equipment ?voltageLevel WHERE {
  ?equipment cimr:mridSignificantPart "2dd903cf" .
  ?equipment cim:Equipment.EquipmentContainer ?container .
  ?container a cim:VoltageLevel .
  BIND(?container AS ?voltageLevel)
}

SELECT ?voltageLevel WHERE {
  ?entity cimr:mridSignificantPart "2dd903cc" .
  ?entity a cim:LinearShuntCompensator .
  ?entity cim:Equipment.EquipmentContainer ?voltageLevel .
}

SELECT DISTINCT ?vl WHERE {
  ?entity cimr:mridSignificantPart "f17695ed" .
  ?entity a cim:VoltageLevel .
  ?entity cimr:connectedThroughPart ?vl .
  ?vl a cim:VoltageLevel .
}

SELECT DISTINCT ?vl WHERE { 
  ?container cim:IdentifiedObject.mRID "f1769672-9aeb-11e5-91da-b8763fd99c5f" .
  ?container a cim:VoltageLevel .
  ?container ^cim:VoltageLevel.Substation|^cim:VoltageLevel.Bays|^cim:VoltageLevel.BaseVoltage ?parent .
  ?vl a cim:VoltageLevel .
  { ?parent cim:Substation.VoltageLevels ?vl } UNION { ?parent cim:VoltageLevel.Bays ?vl } UNION { ?parent cim:VoltageLevel.BaseVoltage ?vl }
}

SELECT ?substation WHERE {
  ?substation a cim:Substation .
  ?substation cimr:hasPartTransitive ?part .
  ?part cim:IdentifiedObject.mRID "d965c17e-a3fe-c447-8139-b55a1201b3b3" .
}

SELECT ?substation ?substationName WHERE {
  ?entity cim:IdentifiedObject.mRID "95f000f9-9c2b-4c4d-9ce5-6ced7a695b08" .
  ?substation a cim:Substation .
  ?substation cimr:hasPartTransitive ?entity .
  OPTIONAL { ?substation cim:IdentifiedObject.name ?substationName }
}

SELECT ?substation WHERE {
  ?substation a cim:Substation .
  ?substation cimr:hasPartTransitive ?part .
  ?part cim:IdentifiedObject.mRID "b61b6279-c21e-8241-aeb7-8d9bd3ead57c" .
}

SELECT ?gu WHERE {
  ?gu a cim:GeneratingUnit .
  ?gu cim:GeneratingUnit.maxOperatingP "1050"^^xsd:float .
  ?gu nc:ScheduleResource ?sr .
  ?sr cimr:mridSignificantPart "3eabc0b3" .
}

SELECT ?gu ?gu_name WHERE {
  ?gu a cim:GeneratingUnit .
  ?gu cim:GeneratingUnit.maxOperatingP "1000"^^xsd:float .
  ?gu nc:ScheduleResource <ae6cb5a5-b679-4307-bc6d-f1fe70cb3a2c> .
  OPTIONAL { ?gu cim:IdentifiedObject.name ?gu_name }
}

SELECT ?gu ?gu_name WHERE {
  ?gu a cim:GeneratingUnit .
  ?gu cim:GeneratingUnit.maxOperatingP "1000"^^xsd:float .
  ?gu nc:ScheduleResource ?sr .
  ?sr cim:IdentifiedObject.mRID "ae6cb5a5-b679-4307-bc6d-f1fe70cb3a2c"^^xsd:string .
  OPTIONAL { ?gu cim:IdentifiedObject.name ?gu_name }
}

SELECT ?baseVoltage ?name ?nominalVoltage WHERE {
  ?baseVoltage a cim:BaseVoltage .
  OPTIONAL { ?baseVoltage cim:IdentifiedObject.name ?name }
  OPTIONAL { ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage }
}

SELECT DISTINCT ?substation WHERE {
  ?bay cimr:mridSignificantPart "bc25cadf" .
  ?bay a cim:Bay .
  ?voltageLevel cim:VoltageLevel.Bays ?bay .
  ?substation cim:Substation.VoltageLevels ?voltageLevel .
}

SELECT ?bay ?voltageLevel ?substation WHERE {
  ?bay cimr:mridSignificantPart "e5943b0f" .
  ?bay a cim:Bay .
  ?bay cim:Bay.VoltageLevel ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Substation ?substation .
}

SELECT ?substation ?substationName WHERE {
  VALUES ?bay { <urn:uuid:58f5a32f-aec4-d647-9119-a1b6c15fa01a> }
  ?bay cim:Bay.VoltageLevel ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Substation ?substation .
  OPTIONAL { ?substation cim:IdentifiedObject.name ?substationName }
}

SELECT DISTINCT ?substation WHERE {
  VALUES ?bay { <urn:uuid:b61b6279-c21e-8241-aeb7-8d9bd3ead57c> }
  ?bay cim:Bay.VoltageLevel ?voltageLevel.
  ?voltageLevel cim:VoltageLevel.Substation ?substation.
}

SELECT ?substation ?substationName WHERE {
  VALUES ?bay { <urn:uuid:c356ea84-abae-cb43-895f-7118f2f82b3e> }
  ?bay cim:Bay.VoltageLevel ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Substation ?substation .
